package com.yaowang.lansha.entity;import java.io.Serializable;import java.util.Date;/** * 抽奖机会抽取日志  * @author  *  */public class ActivityUserLog implements Serializable{	private static final long serialVersionUID = 1L;		/**	 * id	 */	private String id;	/**	 * 领取人id	 */	private String userId;	/**	 * 抽奖次数	 */	private Integer stock;	/**	 * 类型(1:推荐注册,2:连续登陆)	 */	private String type;	/**	 * 备注	 */	private String remark;	/**	 * 领取时间	 */	private Date createTime;		/**	 * 设置id	 */	 public void setId(String id){	 	this.id = id;	 }	 	 /**	  * 获取id	  */	 public String getId(){	 	return this.id;	 }	/**	 * 设置领取人id	 */	 public void setUserId(String userId){	 	this.userId = userId;	 }	 	 /**	  * 获取领取人id	  */	 public String getUserId(){	 	return this.userId;	 }	/**	 * 设置抽奖次数	 */	 public void setStock(Integer stock){	 	this.stock = stock;	 }	 	 /**	  * 获取抽奖次数	  */	 public Integer getStock(){	 	return this.stock;	 }	/**	 * 设置类型(1:推荐注册,2:连续登陆)	 */	 public void setType(String type){	 	this.type = type;	 }	 	 /**	  * 获取类型(1:推荐注册,2:连续登陆)	  */	 public String getType(){	 	return this.type;	 }	/**	 * 设置备注	 */	 public void setRemark(String remark){	 	this.remark = remark;	 }	 	 /**	  * 获取备注	  */	 public String getRemark(){	 	return this.remark;	 }	/**	 * 设置领取时间	 */	 public void setCreateTime(Date createTime){	 	this.createTime = createTime;	 }	 	 /**	  * 获取领取时间	  */	 public Date getCreateTime(){	 	return this.createTime;	 }}